import styled from 'styled-components';

export const ContainerList = styled.div`
    background-color: #FFFFFF;
    padding: 20px;
`;

export const ContainerHeader = styled.div`
    background-color: pink;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    padding-bottom: 20px;

    p {
        font-size: 18px;
        color: #707B81;
        font-weight: bold;
    }
`;
